import React from 'react'
//import imageProfil from '../../assets/img/imadpp.jpg'
import FormAddLinks from './FormAddLinks'
export default function Profil({stars}) {
    return (

        <div>
            <header>
                <h1>Profil</h1>
            </header>
            <div>
                <p>ici:{stars}</p>
            <button> Ajoutez un Lien </button>
            <FormAddLinks />
            </div>
        </div>
    )
}
Profil.getInitialProps = async ctx => {
    const res = await fetch('https://api.github.com/repos/zeit/next.js')
    const json = await res.json()
    return { stars: json.stargazers_count }
  }
